.9  29992.8 \n\nCoefficients:\n                Estimate Std. Error t value Pr(>|t|)    \n(Intercept)     -11938.5      987.8 -12.086  < 2e-16 ***\nage                256.9       11.9  21.587  < 2e-16 ***\nsexmale           -131.3      332.9  -0.394 0.693348    \nbmi                339.2       28.6  11.860  < 2e-16 ***\nchildren           475.5      137.8   3.451 0.000577 ***\nsmokeryes        23848.5      413.1  57.723  < 2e-16 ***\nregionnorthwest   -353.0      476.3  -0.741 0.458769    \nregionsoutheast  -1035.0      478.7  -2.162 0.030782 *  \nregionsouthwest   -960.0      477.9  -2.009 0.044765 *  \n---\nSignif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n\nResidual standard error: 6062 on 1329 degrees of freedom\nMultiple R-squared:  0.7509,\tAdjusted R-squared:  0.7494 \nF-statistic: 500.8 on 8 and 1329 DF,  p-value: < 2.2e-16\n"},"metadata":{}}]},{"cell_type":"markdown","source":"From the Pr values, we can see that the following factors have the **most satistically significant** relationship with medical charges: \n* age\n* BMI\n* smoker\n* number of children  \n  \n  \nThis factor has a less significant relationship with medical charges, but are still considered satistically significant (Pr value less than 0.05):\n* region\n\n## Conclusion\nTo predict medical charges of an individual for insurance calculations, we should look at their age, BMI, if they smoke, and the number of children they have. To increase the precision in our predictions, we can look at the region they live in too.","metadata":{}}]}